        --byz-neume-font-family: Almouzios;
        --byz-neume-font-size: 20pt;
        
        --byz-lyric-font-family: Source Serif;
        --byz-lyric-font-size: 12pt;
        --byz-lyric-offset-h: 3.6pt;
        --byz-lyric-offset-v: 0pt;

        --byz-drop-cap-font-family: Source Serif;
        --byz-drop-cap-font-size: 60pt;
        --byz-drop-cap-offset-v: 18pt;
        --byz-drop-cap-color: #000000;

        --byz-color-accidental: #ED0000;
        --byz-color-agogi: #ED0000;
        --byz-color-barline: #ED0000;
        --byz-color-fthora: #ED0000;
        --byz-color-gorgon: #ED0000;
        --byz-color-heteron: #ED0000;
        --byz-color-ison-indicator: #ED0000;
        --byz-color-koronis: #ED0000;
        --byz-color-martyria: #ED0000;
        --byz-color-measure-number: #000000;
        --byz-color-note-indicator: #ED0000;
      }
      
      body {
        margin: 72px 72px 72px 72px;
      }

      @page {
        margin: 72px 72px 72px 72px;
        size: Letter portrait
      }

      @media print {
        body {
          margin: 0;
        }
      }

      @media screen and (max-width: 768px) {
        body {
          margin: 24px;
        }
      }

      x-ly {
        color: #000000;
      }

      x-dc {
        font-weight: 400;
        font-style: normal;
        -webkit-text-stroke-width: 0;
      }

      x-gor, x-pel {
        --byz-neume-font-size: 12pt;
        line-height: 12pt;
      }

      x-m.byz--m-align-right {
        margin-left: auto;
      }

      .byz--line-break {
        margin-left: auto;
      }

      .byz--text-box {
        white-space: break-spaces;
        font-family: Source Serif;
        font-size: 20pt;
        font-weight: 400;
        font-style: normal;
        color: #000000;
        -webkit-text-stroke-width: 0;
      }

      .byz--text-box-inline {
        display: flex;
        align-items: center;
      }

      .byz---rich-text-box {
        font-family: Source Serif;
        font-size: 20pt;
      }

      .byz--image-box {
        display: flex;
        align-items: center;
      }

      .byz--mode-key {
        position: relative;
        font-size: 20pt;
        color: #ED0000;
        -webkit-text-stroke-width: 0;
      }

      .byz--mode-key-right-container {
        position: absolute;
        right: 0;
      } 

      .byz--mode-key-ambitus {
        position: relative;
        top: -4px;
      }

      .byz--mode-key-ambitus-text {
        font-family: Arial, Helvetica, sans-serif;
      }

      .byz--mode-key-ambitus-low {
        margin-right: 10px;
        position: relative;
        top: -12px;
      }

      .byz--mode-key-ambitus-high {
        margin-left: 2px;
        margin-right: 4px;
        position: relative;
        top: -12px;
      }

      .byz--mode-key .byz--t {
        position: relative;
        top: -9pt;
        margin-left: 8px;
      }

      .byz--mode-key .byz--t-align-right {
        position: absolute;
        right: 0;
      }

      .byz--neume-paragraph {
        display: flex;
        flex-wrap: wrap;
        justify-content: space-between;
        margin-bottom: 20pt;
        
      }

      x-m {
        margin-bottom: 28pt;
        margin-right: 8pt;
      }

      .byz--neume-paragraph:last-child {
        margin-bottom: 0;
      }

      .byz--neume-paragraph-center {
        justify-content: center;
      }
